import XCTest
@testable import Leetcode;

final class LongestSubstringTests: XCTestCase {
    
    func test1() throws {
        // arrange
        let value = "abcabcbb"
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 3)
    }
    
    func test2() throws {
        // arrange
        let value = "bbbbb"
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 1)
    }
    
    func test3() throws {
        // arrange
        let value = "pwwkew"
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 3)
    }
    
    func test4() throws {
        // arrange
        let value = " "
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 1)
    }
    
    func test5() throws {
        // arrange
        let value = ""
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 0)
    }
    
    func test6() throws {
        // arrange
        let value = "boalgmrjuylfwbperszskbbpcwflbwldmmotyieuirzetrikjhfwkilneqagollbxbwxlas"
        let solution = Solution()
        
        // act
        let length = solution.lengthOfLongestSubstring(value)
        
        // assert
        XCTAssertEqual(length, 13)
    }
    
